import React from 'react';
import Logo from '../../assets/img/logo.png';
import './Menu.css';

function Menu() {
    return (
        <nav className="Menu">
            <a>
                <img className="Logo" src={Logo} alt="3DFlix Logo" />
            </a>
        </nav>
    );
}

export default Menu;
